import React from "react";
import { Text, StyleSheet, Button, View} from "react-native";

const HomeScreen = () => {

  return (
    <View>
  <Text style={styles.text}>HomeScreen</Text>
  <Button title="Click Here" />
  </View>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
